import React from "react";
// import styles
import "./Tasks.scss";
//import edit icon
import editSvg from "../../assets/img/edit.svg";

const Tasks = () => {
  return (
    <div className="tasks">
      <h2 className="tasks__title">
        Front-End
        <img src={editSvg} alt="edit icon" />
      </h2>
    </div>
  );
};

export default Tasks;
